css:
atom-text-editor.editor .refactor-reference .region {
  border-radius: 2px;
  box-sizing: border-box;
  background-color: rgba(54, 175, 144, 0.2);
  border: 1px solid rgba(54, 175, 144, 0.3);
}
atom-text-editor.editor .refactor-ref .region {
  border-bottom: 1px solid green;
}
atom-text-editor.editor .refactor-mut .region {
  border-bottom: 2px solid red;
}
atom-text-editor.editor .refactor-decl .region {
  border-bottom: 2px solid orange;
}
atom-text-editor.editor .refactor-error .region {
  box-sizing: border-box;
  border-bottom: 1px dotted #ff0000;
}
atom-text-editor.editor .gutter .line-number.refactor-error .icon-right {
  visibility: visible;
}
atom-text-editor.editor .gutter .line-number.refactor-error .icon-right:before {
  content: "\f02d";
  color: #f42a2a;
}
